// отображение массива
void ShowArray(int arr[], int size) {
	for (int i = 0; i < size; i++) {
		cout << arr[i] << " ";
	}
	cout << endl;
}
// в отличии от обычных переменных изменения элементов массива, происходящие внутри функции при выходе из функции сохраняются
void InitArray(int arr[], int size) {
	for (int i = 0; i < size; i++) {
		arr[i] = rand() % 100;
	}
}

void InvertArray(int arr[], int size) {
	for (int i = 0; i < size / 2; i++) {
		int temp = arr[i];
		arr[i] = arr[size - i - 1];
		arr[size - i - 1] = temp;
	}
}
						 
int main() {
	setlocale(LC_ALL, "ru");
	srand(time(NULL));
	const int size = 10;
	int arr[size];
	InitArray(arr, size);
	ShowArray(arr, size);
	InvertArray(arr, size);
	ShowArray(arr, size);
}

#include <iostream>

using namespace std;
bool kpal(int v[101],int n,int k)
{
    int r[101];
    int nr=1;

    for(int i=k+1;i<=n;i++)
    {
        r[nr]=v[i];
        nr++;
    }
    for(int i=1;i<=k;i++)
    {
        r[nr]=v[i];
        nr++;
    }
    int st=1;int dr=n;
    while(st<=dr)
    {
        if(r[st]!=r[dr])
        {
            return 0;
        }
        st++;
        dr--;
    }
    return 1;

}
int main()
{
    int n;
    cin>>n;
    int v[101];
    for(int i=1;i<=n;i++)
    {
        cin>>v[i];
    }
    int k;
    cin>>k;
    cout<<kpal(v,n,k);

    return 0;
}

