}
// в отличии от обычных переменных изменения элементов массива, происходящие внутри функции при выходе из функции сохраняются
void InitArray(int arr[], int size) {
	for (int i = 0; i < size; i++) {
		arr[i] = rand() % 100;
	}
}

void CheckArray(int arr[], int size) {
	int min = arr[0];
	int max = arr[0];
	int min_index = 0;
	int max_index = 0;

	for (int i = 0; i < size; i++) {
		if (arr[i] < min) {
			min = arr[i];
			min_index = i;
		}
		if (arr[i] > max) {
			max = arr[i];
			max_index = i;
		}
	}
	cout << "Минимальное значение: " << min << ", индекс: " << min_index << endl;
	cout << "Максимальное значение: " << max << ", индекс: " << max_index << endl;
}
						 
int main() {
	setlocale(LC_ALL, "ru");
	srand(time(NULL));
	const int size = 10;
	int arr[size];
	InitArray(arr, size);
	ShowArray(arr, size);
	CheckArray(arr, size);
}

from functools import lru_cache


def moves(h):
    a = h
    return a + 7, a * 2


@lru_cache(None)
def game(h):
    if h >= 100:
        return 'WIN'
    elif any(game(m) == 'WIN' for m in moves(h)):
        return 'P1'
    elif all(game(m) in ['P1'] for m in moves(h)):
        return 'V1'
    elif any(game(m) == 'V1' for m in moves(h)):
        return 'P2'
    elif all(game(m) in ['P1', 'P2'] for m in moves(h)):
        return 'V2'


def p19(h):
    return any(game(m) == 'P1' for m in moves(h))


print([s for s in range(1, 100) if p19(s)]) #ваня выиграл первым ходом
print([s for s in range(1, 100) if game(s) == 'P2']) #петя вторым ходом
print([s for s in range(1, 100) if game(s) == 'V2'])

