        }

        std::cout << std::endl;
    }

    std::cout << std::endl;

    return 0;
}

#include <iostream>

using namespace std;

void ShowPerfectNumber(int a, int b) {
	int n = 0; // считаем сумму делителей
	for (int i = a; i <= b; i++) {
		for (int j = 1; j < i; j++) { 
			if (i % j == 0) { // если да, то j - делитель числа
				n += j; // и тогда добавляем его в n
			}
		}
		if (n == i) { // если сумма делителей равна проверяемому числу
			cout << i << " "; // выводим совершенное число в консоль
		}
		n = 0;
	}
	cout << endl;
}


int main() {
	setlocale(LC_ALL, "ru");
	ShowPerfectNumber(1, 10000);
}

